@-moz-document domain("foodemperor.com") {
::-webkit-scrollbar-track {
             -webkit-box-shadow: inset 0 0 0px rgba(0, 0, 0, 0.3);
             border-radius: 2px;
             background-color: #212121;
        }
        html[hide-scrollbar="true"] ::-webkit-scrollbar{display:none}
        ::-webkit-scrollbar {
             width: 10px;
             background-color: #212121;
        }
        ::-webkit-scrollbar-thumb {
             border-radius: 2px;
             -webkit-box-shadow: inset 0 0 6px rgba(0, 0, 0, .6);
             background-color: #ef0;
			 border: 2px solid #000;
        }

body {
	background: #111;
	color: #b5b5b5;
}
.page-head-title, .site-foot a, .post-content-body h1, .post-content-body h2, .post-content-body h3, .post-content-body h4, .post-content-body h5, .post-content-body h6, .post-content-title, .post-content-excerpt, .site-head-left a, .site-head-right a, .kg-card figcaption {
	color: #e3e3e3;
}
[src='/content/images/2020/08/99D5F004-CBC9-40BA-A97F-F3C444AA5159.png'], [src='https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcSQelvBbQ1v1gG1S5lwmg04MZKK3JlSRIIBvIWTC_i4XnQTrtvEqfx3BXI'], [src='https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcS_Oa013QWFbh1s6PW9wiZNBna1dyMRw3pTQhjxYwGGaiFEZtSymr3Zjag'] {
	content: url('https://i.imgur.com/wmhRfps.png');
}
.site-foot {
	color: #5b5b5b;
}
.error-head p {
	color: #616161;
}
hr {
	border-color: #171717;
}
.post-content-body hr:after {
	background: #171717;
	box-shadow: 0 0 0 5px #111;
}
/*Google Search*/
tbody tr:nth-child(odd) {
	background: #181818;
}
tbody tr, tbody td {
	border-color: #333;
}
.gsc-control-cse {
	background: #111;
	border-color: #111;
}
.gsc-input-box {
	border-color: #3f4044;
	background: #111;
}
input#gsc-i-id1 {
	filter: invert(.90);
	color: #131313;
}
.gsc-webResult.gsc-result {
	border-color: #111;
}
.gsc-above-wrapper-area {
	border-color: #292929;
}
.gs-webResult .gs-snippet, .gs-fileFormatType {
	color: #ccc;
}
.gs-result .gs-image, .gs-result .gs-promotion-image {
	border-color: #222;
}
.gsc-results .gsc-cursor-box .gsc-cursor-page {
	color: #999;
}
.gsc-results .gsc-cursor-box .gsc-cursor-current-page {
    color: #1a73e8;
}
[src='https://www.google.com/cse/static/images/1x/en/branding.png'] {
	filter: invert(1);
}
.gsc-result-info {
	color: #979797;
}
/*End of Google Search*/
}
